  \"2016-11-25T21:06:45.767571\",\n\t\"name\": \"principal-follow-up-survey-2012-13\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The 2012-13 Principal Follow-Up Survey (PFS
  12/13) is a longitudinal follow-up to the 2011-12 Schools and Staffing Survey (SASS
  11-12) study. PFS 12/13 (http://nces.ed.gov/surveys/sass/) determined how many principals
  remained at the same school, moved to another school, or left the profession in
  the year following the 2011-12 Schools and Staffing Survey (SASS 11-12) administration.
  PFS 12/13 was administered to a sample of principals who completed the SASS 11-12
  principal questionnaire. Due to its brevity and lack of skip patterns, PFS 12/13
  was primarily a mail-based data collection with telephone and email follow-up.\",\n\t\"license_title\":
